function generate(receipt, api, notifications, callback) {
    api.generate(receipt).subscribe(function (data) {
        if (data.msg) {
            notifications.show(data.msg);
        }
        else {
            console.log(data);
            var blob = new Blob([data], { type: 'application/pdf' });
            var url = URL.createObjectURL(blob);
            var a = document.createElement('a');
            a.setAttribute('style', 'display:none;');
            document.body.appendChild(a);
            a.download = 'receipt.pdf';
            a.href = url;
            a.click();
            if (callback) {
                callback();
            }
        }
    });
}
function sendMsg(receipt, api, notifications, dialog, callback) {
    dialog.getMailingDetails().subscribe(function (mailingDetails) {
        if (mailingDetails) {
            api.sendMail(receipt, mailingDetails).subscribe(function (data) {
                if (data.success) {
                    notifications.show("Sent Successfully");
                    if (callback) {
                        callback();
                    }
                }
                else {
                    console.log(data);
                    notifications.show(data.msg);
                }
            });
        }
    });
}
function cancel(receipt, api, notifications, dialog) {
    dialog.showYesNo("Confirm Cancellation", "Do you want to cancel this Receipt? This cannot be undone.").subscribe(function (confirm) {
        if (confirm) {
            api.cancel(receipt).subscribe(function (data) {
                if (data.success) {
                    notifications.show('Cancelled');
                }
                else {
                    console.log(data);
                    notifications.show(data.msg);
                }
            });
        }
    });
}
